import React from 'react';
import "../Admin/Admin.css";




import Button from "@mui/material/Button";
import { Divider } from '@mui/material';
import Input from '@mui/joy/Input';


const Admin = () => {
  return (
   
    <>
        <div className="admin-main-div">
            <div className="panel-div">
                <div className="log-btn-dv"> <Button>LOGOUT</Button> </div>
                <div className="adm-text-div">
                    <h3>ADMIN PANEL</h3>
                </div>
                <div className="adm-date-div">
                    <Input type="date" slotProps={{input: {min: '2018-06-07T00:00', max: '2050-06-14T00:00',},}}/>
                </div>
            </div>
            <Divider/>
            <div className="rev-admin-div"></div>
        </div>
    </>
  )
}

export default Admin
